import React from 'react';
import '../../../../App.css';

const hour = (props) => {
    let imgSrc = props.setImg(props.weather);
        return (
            <div className="cardCustom hourCard">
                <p className="hour">{props.hour}</p>
                <div className="row">
                    <p className="temperature col-2">{props.temperature} <sup>C</sup></p>
                    <img src={imgSrc} alt={props.weather} className="images col-2"/>             
                    <div className="information col-8">
                    <p>Brzina vjetra: {props.windSpeed}km/h</p>
                    <p>Mogućnost padavina: {props.chanceOfRain}%</p>
                    <p>Vlažnost vazduha: {props.humidity}%</p>
                    </div>
                </div>
            </div>

        );
}

export default hour;
